@namespace url(http://www.w3.org/1999/xhtml);
@-moz-document domain("quintura.com")


{


/****************** BODY ******************/


.hilightbanner {
background-color: #262626 !important;
}

.highslide-with-border, .highslide-caption, .highslide-display-block {
background-color: #3e3e3e !important;
border-color: #3e3e3e !important;
}

.highslide-with-border * {
color: #000000 !important;
}

body {
background-color: #262626 !important;
}

#content * {
border-color: #3e3e3e !important;
}

#footer * {
border-color: #3e3e3e !important;
}

#copyright {
border-color: #3e3e3e !important;
}

#curpage {
background-color: #8a8a8a !important;
color: #000000 !important;
}

#QueryForm * {
border-color: #262626 !important;
}

.login {
border-color: #3e3e3e !important;
}

.pass {
border-color: #3e3e3e !important;
}

#SearchSettings * {
background-color: #262626 !important;
}

#SearchSettings {
border-color: #3e3e3e !important;
}

#DivDisAll {
background-color: #ffffff !important;
}

#completeDiv {
background-color: #3e3e3e !important;
}


/****************** TEXT ******************/


* {
color:#8a8a8a !important;
}

a:link, a:active {
color:#000000 !important;
}

a:visited {
color: #426d0f !important;
}

a:hover {
color: #8a8a8a !important;
}


/***************** IMAGES *****************/


.header {
background: #262626 url(data:image/png;base64,) repeat-x scroll 0 0 !important;
}

#quinturaLogo {
background: transparent url(data:image/png;base64,) no-repeat scroll 0 0 !important;
}

#inputFindBut {
background:#262626 url(data:image/png;base64,) no-repeat scroll right top !important;
}

.selector div {
background:transparent url(data:image/png;base64,) no-repeat scroll left bottom !important;
}

.selector div a {
background:transparent url(data:image/png;base64,) no-repeat scroll right bottom !important;
}

.selector div.tabActive {
background:#8a8a8a url(data:image/png;base64,) no-repeat scroll left bottom !important;
}

.selector div.tabActive a {
background:transparent url(data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAUAAAASCAYAAAHkuyRQAAAABGdBTUEAALGPC/xhBQAAAAZiS0dEAP8A/wD/oL2nkwAAAAlwSFlzAAALEwAACxMBAJqcGAAAAD5JREFUGNO9jrENACAMwwKrz8n/t5UJJEqZkPCWDJalHSC6JHXb6boCxGmY1GPpHwGiAVEKr+3fzpZzbKsMHsz0DTmj7iaAAAAAAElFTkSuQmCC) no-repeat scroll right bottom !important;
}

#topControls div {
background:#8a8a8a url(data:image/png;base64,) no-repeat scroll left top !important;
}

#topControls div a {
background:transparent url(data:image/png;base64,) no-repeat scroll right top !important;
}

#waitDiv {
background:transparent url(data:image/png;base64,) no-repeat scroll left top !important;
}

#toolbarDiv a.SettingBut_ru {
background:transparent url(data:image/png;base64,) no-repeat scroll left top !important;
}

#toolbarDiv a.shareitButt_ru {
background:transparent url(data:image/png;base64,) no-repeat scroll left top !important;
}

#toolbarDiv a.SettingBut_en {
background:transparent url(data:image/png;base64,) no-repeat scroll left top !important;
}

#toolbarDiv a.shareitButt_en {
background:transparent url(data:image/png;base64,) no-repeat scroll left top !important;
}

.CtrlNew_Act {
background-image:url(data:image/png;base64,) !important;
}

.CtrlNew_Inact {
background-image:url(data:image/png;base64,) !important;
}

.CtrlPrev_Inact {
background-image:url(data:image/png;base64,) !important;
}

.CtrlPrev_Act {
background-image:url(data:image/png;base64,) !important;
}

.CtrlNext_Inact {
background-image:url(data:image/png;base64,) !important;
}

.CtrlNext_Act {
background-image:url(data:image/png;base64,) !important;
}

.lpanel {
background: transparent url(data:image/png;base64,) no-repeat scroll right center !important;
}

img[src*="/images/main/logo_en.gif"] {
width:0px !important;
height: 49px !important;
background:url(data:image/png;base64,) !important;
padding-left: 162px !important;
}

img[src*="/images/blinkx.gif"] {
width:0px !important;
height: 19px !important;
background:url(data:image/png;base64,) !important;
padding-left: 88px !important;
}

img[src*="http://affiliates.quintura.com/promo/en/images/done.gif"] {
width:0px !important;
height: 38px !important;
background:url(data:image/png;base64,) !important;
padding-left: 120px !important;
}

img[src*="/img/affiliates/logo_en.gif"] {
width:0px !important;
height: 54px !important;
background:url(data:image/png;base64,) !important;
padding-left: 128px !important;
}


/*********** BLANKED OUT IMAGES ***********/


#topControls * {
background: none !important;
}

.l, .r, .logo {
background: none !important;
}

#topBar {
background: none !important;
}


}
